import React from 'react';
import { render } from '@testing-library/react';
import './style.css'

function App() {
  render() 
  return (
    <center>
      <head>

    <title>Sign Up Page</title>


  </head>
  <body>

    <section class="overlay">
			<h1 id = "first">Sign Up</h1>
      <p id = "create">Create an account:</p>
      {/*<form action="submission.html" method="GET">*/}
        <label for="usernames" id = "username">Username:</label>
        <br/>
				<input id="usernames" name="username" type="text"  minlength="3"  maxlength="15"/>
        <br/>
        <label for="usernames" id = "username">Password:</label>
        <br/>

				<form action="submission.html" method = "GET"><input id="usernames" name="pw" type="password" required minlength="8" maxlength="15"/></form>
        <br/> <br/>
        <input type="submit" value="Submit"/>

  {/*</form>*/} 

    </section></body></center>



  )
}
export default App;
